import Error from './../Error/error'
import React from 'react'
import PostHelp from './../exampl/Header'

import Header from './../Header/Header'
import { Route , Routes, Navigate} from 'react-router-dom';


const AppRouter=()=>{
    return(

        <Routes>
        <Route path="/main" element={<h1>Main</h1>}/>
        <Route exact path="/gum" element={<PostHelp />}/>
        <Route exact path="/ch" element={<Header />}/>
        <Route exact path="/nh" element={<h1>neeed help</h1>}/>
        <Route exact path="/login" element={<h2>voitiiiii</h2>}/>
        
        <Route
                            path="*"
                            element={<Error to="/Error" />}
                        />
        </Routes>

    )}



export default AppRouter
